import { Search } from '@material-ui/icons'
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    height: 60px;
`
const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
`
const Left = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
    font-size: 20px;
`

const Center = styled.div`
    flex: 1;
    font-size: 20px;
`

const SiteLogo = styled.h1`
    font-weight: bold;
`

const Right = styled.div`
    align-items: center;
    flex: 1;
    display: flex;
`
const Language = styled.span`
    font-size: 20px;
    cursor: pointer;
`
const SearchContainer = styled.div`
    margin-right: 40px;
    padding: 3px;
    display: flex;
    align-items: center;
    border: 1px solid black;
`
const SearchInput = styled.input`
    align-items: center;
    border: none;
`

const Navbar = () => {
  return (
    <Container>
        <Wrapper>
        <Left>
            left
        </Left>
        <Center>
            <></><SiteLogo/>
        </Center>
        <Right>
            <SearchContainer>
                <SearchInput/>
                <Search/>
            </SearchContainer>
        <Language>BG</Language>
        </Right>
        </Wrapper>
    </Container>
  )
}

export default Navbar
